import { Route, Switch } from "react-router-dom";
import OdjelList from "./OdjelList";
import Nesto from "./nesto";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <OdjelList />
        </Route>
        <Route path="/nesto">
          <Nesto />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
